import Axio from './AxiosCalls'

export class Funciones{
    constructor(){
        this.data = null;
        this.information = null;
    }

    datosTabla(params) {
        return Axio.get('getRef.do?'+{params})
        .then((response)=>response.json)
        .then(function(data){
            this.data=data;
        }.bind(this))
    }

}
